import styled from 'styled-components';

const CreateUserWrapper = styled.div`
  display: flex;
  flex-direction: row;
  height: 40px;
  margin-top: 10px;
`;

const UserNameInput = styled.input`
  font-size: 14px;
  padding: 0 15px;
  width: 100%;
`;

export {
  UserNameInput
}
